import React, { Component } from "react";
import Arrow from "./Arrow";
import "./page1.css";

class Sources extends Component {
    constructor(props){
        super(props);
            this.state ={
                facebook: false,
                twitter: false,
                instagram : false,
                youtube : false,
                showArrow: false
            }
    }
    handleChange = (e) => {
        if(this.state.facebook === true || this.state.twitter === true || this.state.youtube === true || this.state.instagram === true){
            this.setState({
                showArrow : true
            })
        }
        let name = e.target.name;
        let var_name = "this.state." + name;
        console.log(var_name);
        if(var_name === true){
            this.setState({
                [e.target.name] : false
            })
        }
        else {
            this.setState({
                [e.target.name] : true
            })
        }
        
        if(this.state.facebook === true || this.state.twitter === true || this.state.youtube === true || this.state.instagram === true){
            this.setState({
                showArrow : true
            })
        }
    }

    
    render(){
        return(
            <div className= "sources">
                <div>
                    <div>
                    <input type="checkbox" name="facebook" value={this.state.facebook} defaultChecked={this.state.facebook} onChange={this.handleChange}/>
                    <img src="data:image/png;base64,"
                    alt ="facebook" height="50px" width="50px"/>
                    </div>
                    <div>
                    <input type="checkbox" name="twitter" value={this.state.twitter} defaultChecked={this.state.twitter}onChange={this.handleChange}/>
                    <img src="data:image/png;base64,"
                    alt ="facebook" height="50px" width="50px"/>
                    </div>
                    <div>
                    <input type="checkbox" name="youtube" value={this.state.youtube} defaultChecked={this.state.youtube}onChange={this.handleChange}/>
                    <img src="data:image/jpeg;base64,"
                    alt ="facebook" height="50px" width="50px"/>
                    </div>
                    <div>
                    <input type="checkbox" name="instagram" value={this.state.instagram} defaultChecked={this.state.instagram}onChange={this.handleChange}/>
                    <img src="data:image/jpeg;base64,"
                    alt ="facebook" height="50px" width="50px"/>
                    </div>
                </div>
                { this.state.showArrow ? <Arrow /> : null }
            </div>
        )
    }
}

export default Sources;